import React from 'react';
import './App.css';
import { connect } from 'react-redux';
import {nameData} from './actions/formActions'
import { Container } from '@material-ui/core';
import Typography from '@material-ui/core/Typography';
import NameComponent from './components/nameComponent'
import Welcome from './components/welcome'
import {Route} from 'react-router-dom'

class App extends React.Component{
  classes = {
    container: { 
      backgroundColor: '#ccf0e1', 
      height: '100%', 
      marginTop:'10%',
      padding: '5%'
    },
    heading:{
      color: '#3f51b5'
    }
  };


  doThing = () => {
    this.props.dispatch(nameData({firstName:'Max', middleName: 'tonk', lastName:'Payne'}))
  }

  render(){
    console.log(this.props.screenReducer.screen);
    return (
      <Container maxWidth="md">
        {
            <Typography component="div" style={this.classes.container} >

            <Route path="/" exact render={() => (
                <Welcome />
            )}>

            </Route>

            <Route path="/step1/name" exact render={()=>
              (
                <NameComponent />
              )
            }>

            </Route>

            </Typography>
        }
      </Container>
    );
  }
}

function mapStateToProps(state){
  return state;
}

export default connect(mapStateToProps)(App);
